import React, { Component} from "react";
import { Row, Col} from "react-bootstrap";

class Latecny extends Component{
    state = {
        latency: null,
        ros: null,
    };






    render(){
        return(
            <div>
                <Row className="mb-5">
                    <Col >
                        <h3 className="mt-4">Latecny</h3>
                        <p className="mt-0"> : ms </p>
                    </Col>
                </Row>
            </div>
        );
    }
}

export default Latecny;
